export function getFormData() {
  return [
    {
      "uid": "first_name",
      "data_type": "string",
      "label": "First Name",
      "value": "Maulik",
      "_metadata": {
        "required": true
      }
    },
    {
      "uid": "last_name",
      "data_type": "string",
      "label": "Last Name",
      "value": "Soni",
      "_metadata": {
        "required": true
      }
    },
    {
      "uid": "email",
      "data_type": "string",
      "label": "Email Address",
      "value": "mauliksoni37@gmail.com",
      "_metadata": {
        "required": true
      }
    },
    {
      "uid": "age",
      "label": "Age",
      "data_type": "number",
      "value": "26"
    },
    {
      "uid": "education_group",
      "label": "Education Details",
      "data_type": "group",
      "value": [
        {
          "uid": "jr_college",
          "data_type": "string",
          "label": "Junior College",
          "value": "K. J. Somaiya Science and Commerce"
        },
        {
          "uid": "sr_college",
          "data_type": "string",
          "label": "Degree College",
          "value": "K. J. Somaiya College Engineering and Information Technology"
        }
      ]
    },
    {
      "uid": "address",
      "label": "Address",
      "data_type": "group",
      "value": [
        {
          "uid": "residential_address",
          "data_type": "string",
          "label": "Residential Address",
          "value": "Ghatkopar, Mumbai"
        },
        {
          "uid": "office_address",
          "data_type": "string",
          "label": "Office Address",
          "value": "Kurla, Mumbai"
        }
      ]
    }
  ];
}

export function getFormRules() {
  return [{
    "targetfielduid": "address.office_address",
    "opernadFieldUid": [
      "address.residential_address"
    ],
    "operations": "notEqual",
    "withValue": "Ghatkopar, Mumbai"
  }];
}
